  0: sel_case = '0;
  1: sel_case = {{3{sign_i}}, x1_i};
  2: sel_case = {{2{sign_i}}, x1_i, 1'b0};
  3: sel_case = {{1{sign_i}}, x3_i};
  4: sel_case = {{1{sign_i}}, x1_i, 2'b0};
